import React, { useState } from "react";
import SalesReportTab from "../tabs/SalesReportTab";
import ReservationAnalysisTab from "../tabs/ReservationAnalysisTab";
import RevenueByCustomerTab from "../tabs/RevenueByCustomerTab";
// import ActiveTransitLinesTab from "../tabs/ActiveTransitLinesTab";
import ManageEmployeesLink from "../components/ManageEmployeesLink";

const AdminDashboard = () => {
  const [activeTab, setActiveTab] = useState("sales");

  const renderTabContent = () => {
    switch (activeTab) {
      case "sales":
        return <SalesReportTab />;
      case "reservations":
        return <ReservationAnalysisTab />;
      case "revenue":
        return <RevenueByCustomerTab />;
      case "transitLines":
        return <ActiveTransitLinesTab />;
      default:
        return <SalesReportTab />;
    }
  };

  return (
    <div>
      <h1>Admin Dashboard</h1>
      <ManageEmployeesLink />

      {/* Tab Navigation */}
      <div className="tabs">
        <button
          className={activeTab === "sales" ? "active" : ""}
          onClick={() => setActiveTab("sales")}
        >
          Sales Report
        </button>
        <button
          className={activeTab === "reservations" ? "active" : ""}
          onClick={() => setActiveTab("reservations")}
        >
          Reservations
        </button>
        <button
          className={activeTab === "revenue" ? "active" : ""}
          onClick={() => setActiveTab("revenue")}
        >
          Revenue by Customer
        </button>
        <button
          className={activeTab === "transitLines" ? "active" : ""}
          onClick={() => setActiveTab("transitLines")}
        >
          Active Transit Lines
        </button>
      </div>

      {/* Tab Content */}
      <div className="tab-content">{renderTabContent()}</div>
    </div>
  );
};

export default AdminDashboard;
